class TestInput:
    def __init__(self, json_str):
        self.x = 0
        self.y = 0
        self.theta = 0
        self.sweep = []
        self.parse(json_str)

    def parse(self, json_str):
        parsed_sweep = json.loads(json_str)
        vehicle = parsed_sweep['vehicles'][0]
        self.x = vehicle['x']
        self.y = vehicle['y']
        self.theta = vehicle['theta']
        num_pts = len(vehicle['sweep'])
        sweep_spherical = np.ndarray((num_pts, 3))
        for i in range(num_pts):
            point = vehicle['sweep'][i]
            sweep_spherical[i,0] = point['azimuth']
            sweep_spherical[i,1] = point['elevation']
            sweep_spherical[i,2] = point['range']
        self.sweep = self.sphericalToCartesian(sweep_spherical)

    def sphericalToCartesian(self, spherical):
        """
        Takes an Nx3 numpy array in spherical and returns an Nx2 numpy array in 2D cartesian
        """
        num_pts = len(spherical)
        cartesian = np.ndarray((num_pts, 2))

        for i in range(num_pts):
            point = spherical[i]
            azimuth = point[0]
            elevation = point[1]
            r = point[2]
            x = r * math.cos(azimuth)
            y = r * math.sin(azimuth)
            cartesian[i][0] = x
            cartesian[i][1] = y

        return cartesian


